        url: '/users/me', 
        token,
      })
       console.log('User Data', userData.data);
       console.log('posts', userData.data.posts);
       console.log('messages', userData.data.messages);



    }
    fetchMessage();

    return(
        <div>
            <p>
            <strong>{post.title}</strong> 
            <br/>
             {post.description}
             <br/>
             {post.price} 
             <br/>
             <em>{post.location}</em>
             <br/>
             {post.willDeliver}
        </p>
            <h1>
                WELCOME HOME {user.username.toUpperCase()}!
            </h1>
        </div>
    )
    }

export default Home;
